export default function criarFlashcard({data, index}) {
    return (
        <li key={index}>
            <div className="recall">
                {data.pergunta}
                <ion-icon name="play-outline"></ion-icon>
            </div>
            <div className="recall">
                {data.resposta}
                <img src="./assets/img/setinha.png" alt="desvirar"/>
            </div>
        </li>
    )

}
